import { useState, useEffect } from "react";

const GetMovies = () => {
  useEffect(() => {
    const abortCont = new AbortController();
    fetch(
      "https://unogs-unogs-v1.p.rapidapi.com/aaapi.cgi?q=%7Bquery%7D-!%7Bsyear%7D%2C%7Beyear%7D-!%7Bsnfrate%7D%2C%7Benfrate%7D-!%7Bsimdbrate%7D%2C%7Beimdbrate%7D-!%7Bgenreid%7D-!%7Bvtype%7D-!%7Baudio%7D-!%7Bsubtitle%7D-!%7Bimdbvotes%7D-!%7Bdownloadable%7D&t=ns&cl=%7Bclist%7D&st=adv&ob=%7Bsortby%7D&p=%7Bpage%7D&sa=%7Bandor%7D",
      {
        method: "GET",
        headers: {
          "x-rapidapi-key":
            "3b8ba7d032msh9616bf36969a1a2p1a7015jsn5184b59caa2b",
          "x-rapidapi-host": "unogs-unogs-v1.p.rapidapi.com",
        },
      }
    )
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        console.log(data["ITEMS"]);
      })
      .catch((err) => {
        console.error(err);
      });
    return () => abortCont.abort();
  }, []);
  return (
    <div className="create">
      <h2>Netflix Movies</h2>
    </div>
  );
};

export default GetMovies;
